import React from "react";
import { Navbar, Button, Icon } from "react-materialize";

const Header = props => {
    return (
        <Navbar
            alignLinks="right"
            brand={<a className="brand-logo" href="#">Logo</a>}
            menuIcons={<Icon>menu</Icon>}
            options={{
                draggable: true,
                edge: "left",
                inDuration: 250,
                onCloseEnd: null,
                onCloseStart: null,
                onOpenEnd: null,
                onOpenStart: null,
                outDuration: 200,
                preventScrolling: true
            }}
        >
            <NavItem href="">
                Getting started
            </NavItem>
            <NavItem href="components.html">
                Components
            </NavItem>
            </Navbar>
    )
};

const styles = {
    button: {
        backgroundColor: "#FFF123",
        color: "black"
    }
}

export default Header;
